from collections import defaultdict

class Solution:
    def minAreaRect(self, points):
        point_hash_set = defaultdict(set)
        for p in points:
            point_hash_set[p[0]].add(p[1])
            
        min_area = 1e9
        for i in range(len(points)):
            for j in range(i + 1, len(points)):
                # compute rectangle if necessary points are in the hash set
                if points[i][1] in point_hash_set[points[j][0]] and points[j][1] in point_hash_set[points[i][0]]:
                    dx = abs(points[j][0] - points[i][0])
                    dy = abs(points[j][1] - points[i][1])
                        
                    if dx > 0 and dy > 0:
                        min_area = min(dx*dy, min_area)
                            
                            
        if min_area == 1e9:
            return 0
        else:
            return min_area

